e_config_module(config_module=\"gtsfm.configs\"):\n        # config is relative to the gtsfm module\n        cfg = compose(config_name=\"default_lund_door_set1_config.yaml\")\n        scene_optimizer: SceneOptimizer = instantiate(cfg.SceneOptimizer)\n\n        loader = OlssonLoader(os.path.join(DATA_ROOT, \"set1_lund_door\"), image_extension=\"JPG\")\n\n        sfm_result_graph = scene_optimizer.create_computation_graph(\n            len(loader),\n            loader.get_valid_pairs(),\n            loader.create_computation_graph_for_images(),\n            loader.create_computation_graph_for_intrinsics(),\n            use_intrinsics_in_verification=True,\n            gt_pose_graph=loader.create_computation_graph_for_poses(),\n        )\n\n        # create dask client\n        cluster = LocalCluster(n_workers=2, threads_per_worker=4)\n\n        with Client(cluster), performance_report(filename=\"dask-report.html\"):\n            sfm_result = sfm_result_graph.compute()\n\n        assert isinstance(sfm_result, GtsfmData)\n\n        # ===== densify =====\n        #   step 1: form image dict\n        img_dict = dict()\n        for i in range(len(loader)):\n            img_dict[i] = loader.get_image(i)\n        #   step 2: call densify\n        mvsnet = MVSNets()\n        dense_points = mvsnet.densify(images=img_dict, sfm_result=sfm_result)\n\n        print(f\"Output dense point cloud volume:{dense_points.shape}\")\n\n        &lt;/pre&gt;\n        "},"id":"1210","type":"Div"},{"attributes":{},"id":"1272","type":"UnionRenderers"},{"attributes":{"axis":{"id":"1194"},"dimension":1,"ticker":null,"visible":false},"id":"1196","type":"Grid"},{"attributes":{},"id":"1271","type":"Selection"},{"attributes":{"days":[1,8,15,22]},"id":"1257","type":"DaysTicker"},{"attributes":{"child":{"id":"1002"},"title":"Worker Profile (compute)"},"id":"1212","type":"Panel"},{"attributes":{"data":{"bandwidth":[85683195.4457179,591907298.4028115],"bandwidth-half":[42841597.72285895,295953649.20140576
